import React, { useState, useEffect } from "react";

function BookCar() {
  const [cars, setCars] = useState([]);
  const [selectedCar, setSelectedCar] = useState(null);
  const [booking, setBooking] = useState({
    carId: "",
    customerId: "",
    startDate: "",
    endDate: "",
    totalPrice: 0
  });

  useEffect(() => {
    fetch("http://localhost:8080/api/cars")
      .then(res => res.json())
      .then(data => setCars(data))
      .catch(err => console.error("Error fetching cars:", err));
  }, []);

  const handleChange = (e) => {
    const { name, value } = e.target;
    const updatedBooking = { ...booking, [name]: value };

    // Recalculate total price when dates or car change
    if (name === "carId") {
      const car = cars.find(c => c._id === value);
      setSelectedCar(car || null);
    }

    if (name === "startDate" || name === "endDate" || name === "carId") {
      updatedBooking.totalPrice = calculateTotalPrice(updatedBooking);
    }

    setBooking(updatedBooking);
  };

  const calculateTotalPrice = ({ startDate, endDate, carId }) => {
    if (!startDate || !endDate || !carId) return 0;
    const car = cars.find(c => c._id === carId);
    if (!car) return 0;

    const start = new Date(startDate);
    const end = new Date(endDate);
    const diffDays = Math.ceil((end - start) / (1000 * 60 * 60 * 24));

    if (diffDays <= 0) return 0;
    return diffDays * car.price;
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    fetch("http://localhost:8080/api/bookings", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify(booking)
    })
      .then(res => res.json())
      .then(data => {
        alert("Booking created successfully!");
        console.log(data);
      })
      .catch(err => console.error("Error creating booking:", err));
  };

  return (
    <div style={{ padding: "30px" }}>
      <h2>Book a Car</h2>
      <form onSubmit={handleSubmit}>
        <label>Select Car:</label>
        <select
          name="carId"
          value={booking.carId}
          onChange={handleChange}
          required
        >
          <option value="">-- Select a car --</option>
          {cars.map(car => (
            <option key={car._id} value={car._id}>
              {car.name} ({car.brand}) - ₹{car.price}/day
            </option>
          ))}
        </select>
        <br /><br />

        <input
          type="text"
          name="customerId"
          placeholder="Customer ID"
          value={booking.customerId}
          onChange={handleChange}
          required
        /><br /><br />

        <label>Start Date:</label>
        <input
          type="date"
          name="startDate"
          value={booking.startDate}
          onChange={handleChange}
          required
        /><br /><br />

        <label>End Date:</label>
        <input
          type="date"
          name="endDate"
          value={booking.endDate}
          onChange={handleChange}
          required
        /><br /><br />

        <h3>
          Total Price: ₹{booking.totalPrice ? booking.totalPrice : 0}
        </h3>
        <br />

        <button type="submit">Book Now</button>
      </form>
    </div>
  );
}

export default BookCar;
